INSERT INTO `hotel_description` (`hotel_id`, `date_no`, `hotel_name`, `description`, `more_details`) VALUES
(1, 'Day 01 & Day 02', 'Sigiriya Hotel', 'Avani Bentota Resort, Club Hotel Dolphin, Hotel Sigiriya and Reveal The Collection are popular holiday destinations in themselves with a multi- cultural clientele. Serendib Leisure hotels are nationally and internationally acclaimed for their skilled culinary teams and a professional service staff that goes the extra mile to make guests feel special and cared for.\r\n                Holidays at Serendib Leisure hotels are all about experiencing Sri Lanka and its culture, nature and heritage through all the senses. Serendib Leisure strives to ensure that every guest entering its hotel properties leaves with lasting memories of a truly wonderful tropical island holiday.', 'https://www.serendibleisure.com/hotelsigiriya/'),
(2, 'Day 03 & Day 04', 'EKHO Lake House Polonnaruwa', 'Situated in the heart of Polonnaruwa and upon the banks of the Parakrama Samudraya, is the stylish boutique resort of EKHO Lake House. A property first built in 1870 as a circuit bungalow for agents of the British Government.  EKHO lake house features an outdoor swimming pool and a hot tub. This hotel has a total of 14 rooms; 9 superior rooms, 4 deluxe rooms and the Queen suite which was named after the Queen of England’s stay. The rooms are well equipped with a minibar, safety deposit box, air conditioning and TV with satellite channels. When it comes to dining, guests have the opportunity to either dine in-room or at the restaurant. Free Wi-Fi and free onsite parking facilities are provided by this hotel. Enjoy a comfortable stay with luxury whilst you visit popular attractions of Polonnaruwa and other ancient cities in the Cultural Triangle. For more information on excursions and activities please do refer the pages of Things to do in Polonnaruwa and Things to do in the Cultural Triangle.', 'https://www.ekhohotels.com/ekholakehouse/'),
(3, 'Day 05 & Day 06', 'The Heritage Hotel Anuradhapura', 'Conveniently located in Anuradhapura, The Heritage Hotel is a great base from which to explore this vibrant city. The city center is merely 2.0 km away and the airport can be reached within 240 minutes. A haven of rest and relaxation, the hotel will offer total renewal just steps away from the city\'s numerous attractions such as Tissa Wewa, Thissa Wewa Reservoir, Isurumuniya Temple.\r\n\r\nThe Heritage Hotel offers impeccable service and all the essential amenities to invigorate travelers. The hotel offers access to a vast array of services, including 24-hour room service, free Wi-Fi in all rooms, 24-hour security, daily housekeeping, postal service.\r\n\r\nAll guest accommodations feature thoughtful amenities to ensure an unparalleled sense of comfort. The hotel offers fantastic facilities, including outdoor pool, spa, massage, children\'s playground, pool (kids), to help you unwind after an action-packed day in the city. The Heritage Hotel is a smart choice for travelers to Anuradhapura, offering a relaxed and hassle-free stay every time.', 'http://www.heritagehotel.lk/'),
(4, 'Day 07 & Day 08', 'Grand Hotel Nuwara Eliya', 'The Grand Hotel is a four-star boutique hotel[1] in Nuwara Eliya, Sri Lanka, that was built in the style of an Elizabethan-era manor house.[2] The hotel has 154 rooms, including three presidential suites, four junior suites, including a governor\'s suite that have been maintained to preserve the traditional design.[2] The Grand Hotel has a number of restaurants, bars and a billiards room.', 'https://thegrandhotelnuwaraeliya.com/'),
(5, 'Day 09 & Day 10', 'Bopath fall Hotel Rathnapura', 'Our prime concern is to provide our loyal customers a wonderful holiday experience. To action out our concerns we provide prime facilities to make your stay a Comfortable and a pleasant stay. Our mission is to offer every guest the most excellent conveniences during their stay with us, in guest rooms and suites that offer breath taking views of our surroundings. We are ready to serve you throughout your stay at Bopathfalls.', 'http://www.bopathfalls.com/'),
(6, 'Day 11 & Day 12', 'Roshara Nalla Hotel Giriulla', 'Roshara Nalla features a restaurant, shared lounge, a garden and water sports facilities in Giriulla. Among the facilities at this property are a shared kitchen and room service, along with free WiFi throughout the property. The hotel provides an outdoor swimming pool, fitness center, evening entertainment and a 24-hour front desk. At the hotel, the rooms include a desk. At Roshara Nalla each room comes with a flat-screen TV, a private bathroom, and a patio with a lake view. Guests at the accommodations can enjoy a continental or a buffet breakfast. Roshara Nalla offers a terrace. The area is popular for fishing, and car hire is available at the hotel. Roshara Nalla also provides a business center and free private parking. Negombo is 21 mi from the accommodations, while Kurunegala is 22 mi away. The nearest airport is Bandaranaike International, 17 mi from Roshara Nalla, and the property offers a paid airport shuttle service.', 'https://rosharanalla.com/'),
(7, NULL, 'Fairway Sunset Galle Hotel', 'History has rooted Galle for hospitable, homely and spacious comfort and these Serviced Apartments have incorporated every one of them for your indulgence. It is an ideal pick for both family and friends to enjoy spacious living with utmost privacy.\r\n\r\nOur Serviced Apartments are fully furnished with an equipped kitchen and simple lounging in contemporary living spaces. Conveniently located close to the Galle Southern Expressway entrance/exit, 800 meters from the bay of Galle with very easy access to scenic hotspots and attractions including the Galle Dutch Fort.\r\n\r\nOur apartments also comprise of added recreational facilities including a swimming pool, gym, mini supermarket & a spa.', 'https://fairwaysunset.com/#nav-aboutssa'),
(8, NULL, 'Hotel Tamarind Tree Thissamaharamaya', 'Located in a convenient place in Thissamaharamaya.Friendly, well-trained staff.Great, Unique FoodsAmple parking.\r\nIn-house Safari jeeps available.\r\nIn-house Airport transfers available.', 'https://hoteltamarindtree.com/'),
(9, NULL, ' Allai Samudra Beach Resort', 'Situated in Jaffna, 8 km from Jaffna Fort, Allai Samudra Beach Resort features accommodation with a restaurant, free private parking, a garden and a private beach area. The property is around 9 km from Jaffna Public Library, 11 km from Nallur Kandaswamy Temple and 24 km from Nilavarai Well. The accommodation provides a 24-hour front desk, airport transfers, room service and free WiFi.\r\n\r\nAll rooms at the hotel are fitted with a seating area. At Allai Samudra Beach Resort, the rooms come with air conditioning and a private bathroom.\r\n\r\nA continental breakfast is available each morning at the accommodation.\r\n\r\nGuests at Allai Samudra Beach Resort will be able to enjoy activities in and around Jaffna, like fishing.\r\n\r\nNaguleswaram Temple is 27 km from the hotel. The nearest airport is Jaffna International Airport, 23 km from Allai Samudra Beach Resort.', 'http://www.allaisamudra.com/'),
(10, NULL, 'Hotel Serandib Hill', 'Hotel Serandib Hill is a colonial type bungalow located at the Heart of Bandarawela in the Badulla District Region, 28 km from Nuwara Eliya. Hotel Serandib Hill features a barbecue and children\'s playground. Guests can enjoy the on-site restaurant. Free WiFi is provided throughout the property and free private parking is available on site.\r\n\r\nCertain units include a seating area for your convenience. All rooms include a private bathroom. A TV is available.\r\n\r\nThere is a 24-hour front desk at the property.\r\n\r\nElla is 8 km from Hotel Serandib Hill, while Udawalawe is 49 km away.', 'https://www.booking.com/hotel/lk/serandib-hill.en-gb.html?aid=356980;label=gog235jc-1DCAsohQFCDXNlcmFuZGliLWhpbGxIM1gDaIUBiAEBmAEJuAEXyAEM2AED6AEBiAIBqAIDuALousCIBsACAdICJGZjMTE3ZmE2LWRkZjItNGY2Zi05NjM1LWQ2MjA4OTg0Y2Q1ONgCBOACAQ;sid=75d251366273773e687a4a5046edb250;dist=0&keep_landing=1&sb_price_type=total&type=total&'),
(11, NULL, 'Dickwella Beach Hotel', 'On tree-lined grounds along Dickwella Beach, this casual hotel is 5 minutes\' walk from Dickwella bus station and 2 km from the Wewurukannala Vihara Buddhist temple.\r\n\r\nThe unpretentious rooms come with complimentary Wi-Fi; some rooms also have air-conditioning, minifridges, furnished balconies and/or ocean views.\r\n\r\nThere\'s a garden, and an open-air restaurant featuring views of the ocean.', NULL),
(12, NULL, 'Grand Hotel Nuwara Eliya', 'The Grand Hotel is a four-star boutique hotel[1] in Nuwara Eliya, Sri Lanka, that was built in the style of an Elizabethan-era manor house.[2] The hotel has 154 rooms, including three presidential suites, four junior suites, including a governor\'s suite that have been maintained to preserve the traditional design.[2] The Grand Hotel has a number of restaurants, bars and a billiards room.\r\n   ', NULL);

