INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(1, 'Sigiriya', 'Sigiriya or Sinhagiri (Lion Rock Sinhala: සීගිරිය, Tamil: சிகிரியா/சிங்ககிரி, pronounced see-gi-ri-yə) is an ancient rock fortress located in the northern Matale District near the town of  Dambulla in the Central Province, Sri Lanka. The name refers to a site of historical and archaeological significance that is dominated by a massive column of rock around 180 metres (590 ft) high.[2]\r\n\r\nAccording to the ancient Sri Lankan chronicle the Culavamsa, this site was selected by King Kashyapa (477 – 495 AD) for his new capital. He built his palace on the top of this rock and decorated its sides with colourful frescoes. On a small plateau about halfway up the side of this rock he built a gateway in the form of an enormous lion. The name of this place is derived from this structure — Sīnhāgiri, the Lion Rock (an etymology similar to Sinhapura, the Sanskrit name of Singapore, the Lion City).\r\n\r\nThe capital and the royal palace were abandoned after the king\'s death. It was used as a Buddhist monastery until the 14th century.[3] Sigiriya today is a UNESCO listed World Heritage Site. It is one of the best preserved examples of ancient urban planning. \r\n       ', , 7.9573, 80.76);
INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(2, 'Polonnaruwa', 'Poḷonnaruwa (Sinhala: පොළොන්නරුව, romanized: Poḷonnaruva; Tamil: பொலன்னறுவ, romanized: Polaṉṉaṟuvai) is the main town of Polonnaruwa District in North Central Province, Sri Lanka. Kaduruwela area is the Polonnaruwa New Town and the other part of Polonnaruwa remains as the royal ancient city of the Kingdom of Polonnaruwa.\r\n\r\nThe second most ancient of Sri Lanka\'s kingdoms, Polonnaruwa was first established by the Chola dynasty after their successful invasion of the country\'s then capital, Anuradhapura, in the 10th century. The Ancient City of Polonnaruwa has been declared a World Heritage Site.[1]\r\n\r\nCurrently the new Polonnaruwa is undergoing a major development project known as the \"Awakening of Polonnaruwa\" under the concept of former President Maithripala Sirisena. It envisions the development of all sectors in Polonnaruwa including roads, electricity, agriculture, education, health and environment will be developed comprehensively.', , 7.9403, 81.0188);
INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(3, 'Horton Plains National Park', 'Horton Plains National Park (Sinhala: හෝර්ටන් තැන්න ජාතික උද්‍යානය Hortan Thanna Jathika Udyanaya) is a national park in the central highlands of Sri Lanka that was designated in 1988. It is located at an elevation of 2,100–2,300 m (6,900–7,500 ft) and encompasses montane grassland and cloud forest. It is rich in biodiversity and many species found here are endemic to the region. It is also a popular tourist destination and is situated 8 kilometres (5.0 mi) from Ohiya, 6 kilometres (3.7 mi) from the world-famous Ohiya Gap/Dondra Watch and 32 kilometres (20 mi) from Nuwara Eliya.\r\n\r\nThe Horton Plains are the headwaters of three major Sri Lankan rivers, the Mahaweli, Kelani, and Walawe. In Sinhala the plains are known as Maha Eliya Plains (මහ එළිය තැන්න). Stone tools dating back to Balangoda culture have been found here. The plains\' vegetation is grasslands interspersed with montane forest and includes many endemic woody plants. Large herds of Sri Lankan sambar deer feature as typical mammals and the park is also an Important Bird Area with many species not only endemic to Sri Lanka but restricted to the Horton Plains. Forest dieback is one of the major threats to the park and some studies suggest that it is caused by a natural phenomenon.\r\n\r\nThe sheer precipice of World\'s End and Baker\'s Falls are among the tourist attractions of the park.\r\n\r\nIn 20th century there are some records of elephants again in the park.', , 6.8021, 80.8074);
INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(4, 'Bopath Ella Falls', 'Bopath Ella (Sinhala: බෝපත් ඇල්ල) is a waterfall situated in the Ratnapura District of Sri Lanka. It has a shape very similar to the leaf of the Sacred fig or \"Bo\" tree, which has earned it this name. The waterfall is a major tourist attraction in the country. Local myths say that it is haunted and that it hides a treasure trove.\r\n        Bopath Ella is located in a village named Agalwatte in Kuruwita in the Ratnapura District of Sri Lanka.', , 8.3114, 80.4037);
INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(5, 'Atamasthana', 'Atamasthana (අටමස්ථාන) or Eight sacred places are a series of locations in Sri Lanka where the Buddha had visited during his three visits to the country. The sacred places are known as Jaya Sri Maha Bodhiya, Ruwanwelisaya, Thuparamaya, Lovamahapaya, Abhayagiri Dagaba, Jetavanarama, Mirisaveti Stupa and Lankarama. They are situated in Anuradhapura, the capital of the ancient Anuradhapura Kingdom.\r\n\r\nThe sacred city of Anuradhapura exerted a considerable influence on the development of architecture in the country during several centuries. The city is nominated as a UNESCO World Heritage Site in 1982, it lies 205 km north of the current capital Colombo in island\'s North Central Province, on the banks of the historic Malvathu Oya.\r\n\r\nAccording to the Mahavansa the sacred city was found around 350 BC by Pandukabhaya, the 1st king of the Anuradhapura kingdom and sixth since the arrival of Vijaya. It eventually become the principal shrines of Buddhism including the branch planted of the sacred fig tree, Bodhi tree from Bodhgaya, under which Siddharta attained spiritual enlightenment and supreme wisdom. The sacred tree brought there in the 3rd century BC during the second mission, led by Sangamitta, a Buddhist nun and daughter of Emperor Ashoka. The relics of Buddha have, moreover, shaped the religious topography of Anuradhapura, where the Thuparamaya was built by Devanampiya Tissa in the 3rd century BC to house the clavicle of Buddha, an important religious relic presented by Emperor Ashoka.[1]\r\n\r\nThe city\'s apogee was reached under the reign of Dutthagamani who, in 161 BC, defeated the South Indian invader Ellalan re-establishing Buddhism in the place of Brahminism and endowed the site with extraordinary monuments including the Mirisaveti Stupa, Ruwanwelisaya, and the Brazen Palace. The city flourished for 1,300 years, then was abandoned after an invasion in 993.', , 7.4827, 80.3728);
INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(6, 'Kurunegala-Athagala', 'Athugala also called as ethagala is a very splendid rock that overlooks the Kurunegala town in Sri Lanka. Athugala is situated just around 1km away from Kurunegala town. The rock gets the name “athugala” due to its shape of an elephant. This is \"the\" iconic landmark of Kurunegala.\r\n\r\n\r\nYou could select two ways to reach to the top of the rock. Either following the steps in the rock or riding your vehicle to the top. Walk to the top of the rock is little tiring and take around 15-20mins, but you\'ll forget that by watching around. Sometimes, you can find few monkey groups in the middle of the rock. So, it is always better to watch out your stuff.\r\n\r\nAs you reach to the top of the rock you could see the temple (Athugala Viharaya) and massive snow white Buddha statue. This temple houses to the huge 88 ft Buddha statue. The great bare rock mountain provides a perfect setting for the Buddha statue. The night view of the Buddha statue from Kurunegala town is simply a breath taking view. Only the snow white Buddha statue can be seen in the sky while the whole surrounding is in dark. It is like the Buddha statue is floating in the sky. It is a worth visit view and these views make the place memorable.If you are to get the perfect view you need to start climbing the rock in the evening. Stay there at the top of the rock till it gets little dark.\r\n\r\nThe view of Kurunagela city from the top of the rock is panoramic and a treat to the eyes. If you are passing the busy Kurunegala town athugala is a must visit place. Also, if you are to say you visited Kurunegala you need to climb athugala.', , 6.8018, 80.3694);
INSERT INTO `place_description` (`place_id`, `place_name`, `place_description`, `place_image`, `latitude`, `longitude`) VALUES
(7, 'Galle Dutch Fort', 'Galle Fort (Sinhala: ගාලු කොටුව Galu Kotuwa; Tamil: காலிக் கோட்டை, romanized: Kālik Kōṭṭai), in the Bay of Galle on the southwest coast of Sri Lanka, was built first in 1588 by the Portuguese, then extensively fortified by the Dutch during the 17th century from 1649 onwards. It is a historical, archaeological and architectural heritage monument, which even after more than 432 years maintains a polished appearance, due to extensive reconstruction work done by Archaeological Department of Sri Lanka.[1]\r\n\r\nThe fort has a colourful history, and today has a multi-ethnic and multi-religious population.[2][3][4] The Sri Lankan government and many Dutch people who still own some of the properties inside the fort are looking at making this one of the modern wonders of the world.[4][5] The heritage value of the fort has been recognized by the UNESCO and the site has been inscribed as a cultural heritage UNESCO World Heritage Site under criteria iv, for its unique exposition of \"an urban ensemble which illustrates the interaction of European architecture and South Asian traditions from the 16th to the 19th centuries.\"[3]\r\n\r\nThe Galle Fort, also known as the Dutch Fort or the \"Ramparts of Galle\", withstood the Boxing Day tsunami which damaged part of coastal area Galle town. It has been since restored.[2]', NULL, 6.025, 80.218),
(8, 'Nallur Kandaswamy Kovil', 'Nallur Kandaswamy Kovil (Tamil: நல்லூர் கந்தசுவாமி கோவில் Sinhala: නල්ලුරුව ස්කන්ධ කුමාර කෝවිල) is a significant Hindu temple, located in Nallur, Northern Province, Sri Lanka.[2] The presiding deity is Lord Murugan in the form of the holy \'Vel\' in the Sanctum, the primary shrine, and in other forms, namely, Shanmugar, Muthukumaraswami, Valli Kaanthar with consorts Valli and Deivayanai, and Thandayuthapani, sans consorts in secondary shrines in the temple.[3]', NULL, 9.6745, 80.0294),
(9, 'Rawana Falls', 'Ravana Falls (popularly known as Ravana Alla රාවණා ඇල්ල in Sinhala) is a popular sightseeing attraction in Sri Lanka. It currently ranks as one of the widest falls in the country.\r\n\r\nThis waterfall measures approximately 25 m (82 ft) in height and cascades from an oval-shaped concave rock outcrop. During the local wet season, the waterfall turns into what is said to resemble an areca flower with withering petals. But this is not the case in the dry season, where the flow of water reduces dramatically. The falls form part of the Ravana Ella Wildlife Sanctuary, and is located 6 km (3.7 mi) away from the local railway station at Ella.[2]', NULL, 6.8407, 81.0542),
(10, 'Yala National Park Safari', 'Yala (යාල) National Park is the most visited and second largest national park in Sri Lanka, bordering the Indian Ocean. The park consists of five blocks, two of which are now open to the public, and also adjoining parks. The blocks have individual names such as, Ruhuna National Park (Block 1), and Kumana National Park or \'Yala East\' for the adjoining area. It is situated in the southeast region of the country, and lies in Southern Province and Uva Province. The park covers 979 square kilometres (378 sq mi) and is located about 300 kilometres (190 mi) from Colombo. Yala was designated as a wildlife sanctuary in 1900, and, along with Wilpattu was one of the first two national parks in Sri Lanka, having been designated in 1938. The park is best known for its variety of wild animals. It is important for the conservation of Sri Lankan elephants, Sri Lankan leopards and aquatic birds.\r\n\r\nThere are six national parks and three wildlife sanctuaries in the vicinity of Yala. Among the largest is Lunugamvehera National Park. The park is situated in the dry semi-arid climatic region and rain is received mainly during the northeast monsoon. Yala hosts a variety of ecosystems ranging from moist monsoon forests to freshwater and marine wetlands. It is one of the 70 Important Bird Areas (IBAs) in Sri Lanka. Yala harbours 215 bird species including six endemic species of Sri Lanka. The number of mammals that has been recorded from the park is 44, and it has one of the highest leopard densities in the world.\r\n\r\nThe area around Yala has hosted several ancient civilizations. Two important pilgrim sites, Sithulpahuwa and Magul Vihara, are situated within the park. The 2004 Indian Ocean tsunami caused severe damage on the Yala National Park and 250 people died in its vicinity. The number of visitors has been on the rise since 2009, after the security situation in the park improved.', NULL, 6.2755, 81.3582),
(11, 'Nuwara Eliya', 'Nuwara Eliya (Sinhala: නුවර එළිය [nuwərə ɛlijə]; Tamil: நுவரெலியா) is a city in the hill country of the Central Province, Sri Lanka. Its name means \"city on the plain (table land)\" or \"city of light\". The city is the administrative capital of Nuwara Eliya District, with a picturesque landscape and temperate climate. It is at an altitude of 1,868 m (6,128 ft) and is considered to be the most important location for tea production in Sri Lanka. The city is overlooked by Pidurutalagala, the tallest mountain in Sri Lanka. Nuwara Eliya is known for its temperate, cool climate – the coolest area in Sri Lanka.', NULL, 6.9497, 80.7891),
(12, 'Hummanaya', 'Hummanaya Blowhole is the only known blowhole in Sri Lanka and it is considered to be the second largest blowhole in the world.[1] Hummanaya (Sinhala: හුම්මානය = හූ+මානය) refers to the noise, \"hoo\", that can be heard a distance away when the blowhole is active.[2]', NULL, 5.9776, 80.7386),
(13, 'Rumassala/Unawatuna', 'The description of the beach paradises in Valmiki\'s epic Ramayana sounds like Unawatuna. \"a seashore dotted with thousands of trees, coconuts, and palms dominating, strings of houses and hermitages along the coastline, human beings and superior beings such as Gandharvas, Siddhas, and ascetics, living in them and countless bejewelled celestial nymphs thronging the shore, the coast intermittently visited by heavenly beings, Gods and demons.\": Unawatuna traces its roots to the great epic Ramayana. In the epic, the monkey-warrior Hanuman was sent back to India to fetch the four medicinal herbs by Jambavan namely, mritasanjeevani, vishalyakarani, suvarnakarani, and sandhani from the Himalayas in order to heal Lakshman who was wounded trying to save the abducted Princess Sita from the demon king Ravana. Hanuman failed to identify these herbs, so he lifted the entire mountain and carried it to the battlefield to try to save Lakshman, but in the process, a chunk of it \"fell-down\" in the location of the present day Unawatuna, the name of the village derives from \"Una-watuna\" meaning \"fell down\". Currently, an edifice is being built in honour of Hanuman on the harbour end of Rumassala Hill by Japanese monks of the Mahayana sect of Buddhism near the Peace Pagoda that they built.', NULL, NULL, NULL),
(14, 'Jungle Beach', 'The description of the beach paradises in Valmiki\'s epic Ramayana sounds like Unawatuna. \"a seashore dotted with thousands of trees, coconuts, and palms dominating, strings of houses and hermitages along the coastline, human beings and superior beings such as Gandharvas, Siddhas, and ascetics, living in them and countless bejewelled celestial nymphs thronging the shore, the coast intermittently visited by heavenly beings, Gods and demons.\": Unawatuna traces its roots to the great epic Ramayana. In the epic, the monkey-warrior Hanuman was sent back to India to fetch the four medicinal herbs by Jambavan namely, mritasanjeevani, vishalyakarani, suvarnakarani, and sandhani from the Himalayas in order to heal Lakshman who was wounded trying to save the abducted Princess Sita from the demon king Ravana. Hanuman failed to identify these herbs, so he lifted the entire mountain and carried it to the battlefield to try to save Lakshman, but in the process, a chunk of it \"fell-down\" in the location of the present day Unawatuna, the name of the village derives from \"Una-watuna\" meaning \"fell down\". Currently, an edifice is being built in honour of Hanuman on the harbour end of Rumassala Hill by Japanese monks of the Mahayana sect of Buddhism near the Peace Pagoda that they built.\r\n', NULL, NULL, NULL),
(15, 'Hikkaduwa coral garden', 'Hikkaduwa National Park is one of the three marine national parks in Sri Lanka. The national park contains a fringing coral reef of high degree of biodiversity. The area was declared a wildlife sanctuary on May 18, 1979, and then on August 14, 1988, upgraded to a nature reserve with extended land area.[1] The growth of the number of visitors in the next 25 years increased the degradation of the coral reef. To reduce the effects to the ecosystem, the reef was declared a national park on September 19, 2002 Hikkaduwa coral reef is a typical shallow fringing reef with an average depth of around 5 metres (16 ft).[2] The coral reef reduces the coastal erosion and forms a natural breakwater.[1] The coast of the national park extends four km. Generally the coast is narrow, ranging from 5–50 m according to the climatic conditions of the year. Scuba diving is a popular recreation here.', NULL, NULL, NULL),
(16, 'Hambantota national port and city', 'Hambantota (Sinhala: හම්බන්තොට, Tamil: அம்பாந்தோட்டை) is the main town in Hambantota District, Southern Province, Sri Lanka. This underdeveloped area was hit hard by the 2004 Indian Ocean tsunami and is undergoing a number of major development projects including the construction of a new sea port and international airport finished in 2013. These projects and others such as Hambantota Cricket Stadium are said to form part of the government\'s plan to transform Hambantota into the second major urban hub of Sri Lanka, away from Colombo The Hambantota International Port (also known as the Magampura Mahinda Rajapaksa Port or the Magam Ruhunupura Mahinda Rajapaksa Port) is a deep water port in Hambantota, Sri Lanka. It was opened on 18 November 2010, and is Sri Lanka\'s second largest port, after the Port of Colombo. In 2020, the port handled 1.8 million tonnes of LPG and dry bulk cargo.[3] Construction of the port commenced in January 2008. In 2016, reported an operating profit of US$1.81 million but was considered economically unviable.[4] As debt repayment got difficult, the newly-elected government decided to privatise an 80% stake of the port to raise foreign exchange in order to repay maturing sovereign bonds unrelated to the port.[5][6] Of the two bidding companies, China Merchants Port was chosen,[5] which was to pay US$1.12 billion to Sri Lanka and spend additional amounts to develop the port into full operation\r\n', NULL, NULL, NULL),
(17, 'Thirukoneswaram Kovil', 'Koneswaram temple of Trincomalee (Tamil: திருக் கோணேச்சரம் கோயில்) or Thirukonamalai Konesar Temple – The Temple of the Thousand Pillars and Dakshina-Then Kailasam is a classical-medieval Hindu temple complex in Trincomalee, a Hindu religious pilgrimage centre in Eastern Province, Sri Lanka. The most sacred of the Pancha Ishwarams of Sri Lanka, it was built significantly during the reign of the early Cholas and the Five Dravidians of the Early Pandyan Kingdom on top of Konesar Malai, a promontory overlooking Trincomalee District, Gokarna bay and the Indian Ocean. Its Pallava, Chola, Pandyan and Jaffna design reflect a continual Tamil Saivite influence in the Vannimai region from the classical period. The monument contains its main shrine to Shiva in the form Kona-Eiswara, shortened to Konesar. Connected at the mouth of the Mahavilli Ganga River to the footprint of Shiva at Sivan Oli Padam Malai at the river\'s source, the temple symbolically crowns the flow of the Ganges River from Shiva\'s head of Mount Kailash to his feet.', NULL, NULL, NULL),
(18, 'Nilaveli Uppuveli beach', 'Nilaveli (Tamil: நிலாவெளி, romanized: Nilāveḷi; Sinhala: නිල්වැල්ල, romanized: Nilvælla) is a coastal resort town and suburb of the Trincomalee District, Sri Lanka located 16 km northwest of the city of Trincomalee. A historically popular Tamil village and tourist destination of the district alongside the nearby Uppuveli, the numbers of visitors declined following the 2004 Indian Ocean tsunami and Sri Lankan Civil War, but have risen again since 2010. Pigeon Island National Park, one of the two marine national parks of the region is situated 1 km off the coast of Nilaveli, its many species of vegetation, coral and reef fish contributing to Nilaveli\'s rich biodiversity. The 10th century CE Tamil Nilaveli inscriptions mention the Koneswaram temple as having received a land grant in the Tamil country of one thousand seven hundred and ten acres (two hundred and fifty four vèli) of dry and wet land to meet its daily expenses - revealing the temple\'s role in providing various services to the local community by 900-1000 CE', NULL, NULL, NULL);

